/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `lumenapi`.`afterRatingCreate`
AFTER INSERT ON `ratings` FOR EACH ROW
BEGIN
    UPDATE `lumenapi`.`properties` SET `pro_rating`=
		(select avg(ra.stars) as rat from ratings ra
		where ra.property_id = NEW.property_id
		group by ra.property_id)
		where id = NEW.property_id;
END */;;
DELIMITER ;

DROP TRIGGER IF EXISTS `afterRatingUpdate`;
